To install &lt;br&gt;1. Use your FTP Client or hosting company's control panel to upload&lt;strong&gt; discographyPro&lt;/strong&gt; files to your host server and domain name. &lt;br&gt;2. Go to your hosting company's control panel.&lt;br&gt;
3. Navigate to the database management section and create a MYSQL database.&lt;br&gt;4.
You will be given the database name, username, password and database
url.&amp;nbsp; Enter this information into the form provided by discographyPro when prompted. &lt;br&gt;
&amp;nbsp;&amp;nbsp;&amp;nbsp; a. This information is provided to you by the host on successful creation of your database. &lt;br&gt;
&amp;nbsp;&amp;nbsp;&amp;nbsp; b. (The discographyPro installation process will create the necessary tables and information needed for the website to function). &lt;br&gt;5. &lt;strong&gt;Navigate your browser to www.yourdomain.com/install/index.php &lt;/strong&gt;&lt;br&gt;6.&amp;nbsp; Follow the instructions on the install page and click continue. &lt;br&gt;7. Enter your website information into the form provided by discographyPro. &lt;br&gt;8. When finished click the submit button. &lt;br&gt;9. Remove the install folder from the server and you are done. (See &quot;remove install folder&quot;)

